from cmath import inf
import heapq
from typing import List
# print(500*500*500*27)
# print(100*100*100*27)

class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        n,m = len(board), len(board[0])

        col_max = [[] for _ in range(m)]

        def addColMax(i:int, j:int, x: int)->None:
            if len(col_max[j]) < 3:
                heapq.heappush(col_max[j], (x,i))
            elif x > col_max[j][0][0]:
                heapq.heapreplace(col_max[j], (x,i))

        for i, row in enumerate(board):
            for j, x in enumerate(row):
                addColMax(i,j,x)

        # print(col_max)

        ans = -inf
        for i in range(m):
            for j in range(i+1,m):
                for k in range(j+1,m):
                    for v1,r1 in col_max[i]:
                        for v2,r2 in col_max[j]:
                            for v3,r3 in col_max[k]:
                                if r1!=r2 and r2!=r3 and r1!=r3:
                                    ans = max(ans, v1+v2+v3)
        return ans
